Given an integer n, return true if it is a power of three. Otherwise, return false.
An integer n is a power of three, if there exists an integer x such that n == 3^x.

Example 1:
In: n = 27
Out: true
Explanation: 27 = 3^3

Example 2:
In: n = 0
Out: false
Explanation: There is no x where 3^x = 0.

Example 3:
In: n = -1
Out: false
Explanation: There is no x where 3x = (-1).

Constraints:
-231 <= n <= 231 - 1
Follow up: Could you solve it without loops/recursion?

A:

Here's a solution using a bit of bit-twiddling.

The idea is to use the fact that 3^x is equal to (3^x)2, and that (3^x)2 is equal to 3^x * 3^x.  So we can use this to determine if 3^x is equal to 0.  If it is, then we know that 3^x is not equal to 0, and so 3^x is not equal to 0.  If it is not equal to 0, then 3^x is equal to 3^x * 3^x, which is equal to 3^x.  So we know that 3^x is equal to 3^x.

Here's the code:
public static boolean isPowerOfThree(int n) {
    if (n < 0) {
        return false;
    }
    if (n == 0) {
        return true;
    }
    int x = 1;
    while (n!= 0) {
        if (n % 3 == 0) {
            return false;
        }
        n = n / 3;
        x++;

